import React from 'react';
import {
    Button,
} from "reactstrap";

export const AlarmFila = ({ alarma }) => {

    const confirmarAlarma = () => {
        console.log('confirmando alarma...', alarma.id_alarm);
    };

    return (
        <tr>
            <td>{alarma.id_alarm}</td>
            <td>{alarma.id_veci}</td>
            <td>{alarma.id_guard}</td>
            <td>{alarma.direccion}</td>
            <td>{alarma.name_contact}</td>
            <td>{alarma.numb_contact}</td>
            <td>{alarma.name_contact2}</td>
            <td>{alarma.numb_contact2}</td>
            <td>{alarma.fecha}</td>
            <td><p className='text-primary text-uppercase'>{alarma.estado}</p></td>
            <td className="text-center">
                <Button
                    className="btn-fill"
                    color="success"
                    type="submit"
                    onClick={confirmarAlarma}
                >
                    CONFIRMAR
                </Button>
            </td>
        </tr>
    );
};
